import { Card } from 'antd'
import React from 'react'

function SearchList({list}) {
  return (
    <>

    <Card
    style={{borderRadius:20,marginTop:10}}
    >
        <button>list.name</button>

        <Card.Meta

        description={list.name}
        >

        </Card.Meta>

    </Card>
    </>
  )
}

export default SearchList
